const Game = ({ selectedLanguage }) => {
  const backgroundStyle = {
    backgroundImage: `url(${require('../styles/images/website-background.jpg')})`,
    backgroundSize: 'cover',
    backgroundRepeat: 'no-repeat',
    height: '100vh',
    margin: 0,
    padding: 0,
  };

  return (
    <div style={backgroundStyle}>
      <div className="container mt-5">
        <div className="row justify-content-center">
          <div className="col-md-10">
            <div className="embed-responsive embed-responsive-16by9 shadow-lg rounded">
              <iframe 
                className="embed-responsive-item" 
                src="https://cdn.htmlgames.com/embed.js?game=ClassicBubbleShooter&amp;bgcolor=white" 
                style={{backgroundColor: 'white'}}
                allowFullScreen>
              </iframe>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Game;
